import React from "react";
import "./AboutUs.css";
import VERS from "./VERS.png";

const AboutUs = () => {
  return (
    <div className="All">
      <img src={VERS} alt="Verstand" width="70" height="70" />
      <h1>WELCOME TO VERSTAND BOOKSTOREe library </h1>
    </div>
  );
};

export default AboutUs;
